css:
atom-panel.nuclide-dash.modal {
  overflow: hidden;
  padding: 0;
  user-select: none;
}
.theme-one-dark-ui atom-panel.nuclide-dash.modal,
.theme-one-light-ui atom-panel.nuclide-dash.modal {
  border-bottom: 0;
  box-shadow: 0 6px 12px -2px rgba(0, 0, 0, 0.4);
}
.theme-one-dark-ui atom-panel.nuclide-dash.modal::after,
.theme-one-light-ui atom-panel.nuclide-dash.modal::after {
  content: normal;
}
atom-panel.nuclide-dash.modal atom-text-editor.nuclide-dash-input.nuclide-dash-input {
  margin-bottom: 0;
}
.nuclide-dash-result-list {
  cursor: default;
  margin-bottom: 10px;
}
.nuclide-dash-input-wrapper {
  padding: 10px;
}
.nuclide-dash-result {
  overflow-y: hidden;
}
.nuclide-dash-result.selected {
  background-color: #5a8ae9;
}
.nuclide-dash-alternate-result {
  background-color: #dfe2e7;
}
.nuclide-dash-result.selected .key-binding {
  background-color: #ffffff;
  color: #5a8ae9;
}
.nuclide-dash-result-icon {
  margin-right: 10px;
}
.nuclide-dash-result-icon::before {
  vertical-align: middle;
}
.nuclide-dash-result-meta {
  margin-left: auto;
  white-space: nowrap;
}
.nuclide-dash-result-inner {
  display: flex;
  align-items: center;
  height: 45px;
  padding: 0 10px;
}
.nuclide-dash-result-context-row {
  display: flex;
  height: calc(1em +  10px);
  justify-content: center;
  flex-direction: column;
  padding: 0 5px;
  white-space: nowrap;
}
.nuclide-dash-result-context-row code {
  background-color: transparent;
}
.nuclide-dash-result-body {
  overflow: hidden;
}
.nuclide-dash-result-primary {
  text-overflow: ellipsis;
  overflow-x: hidden;
  white-space: nowrap;
  overflow: hidden;
  color: rgba(0, 0, 0, 0.85);
}
.nuclide-dash-result.selected .nuclide-dash-result-primary {
  color: rgba(255, 255, 255, 0.95);
}
.nuclide-dash-result-prefix {
  background: none;
  border-radius: 3px;
  margin-right: 10px;
}
.nuclide-dash-result-secondary {
  text-overflow: ellipsis;
  overflow-x: hidden;
  white-space: nowrap;
  color: rgba(0, 0, 0, 0.75);
}
.nuclide-dash-result.selected .nuclide-dash-result-secondary {
  color: rgba(255, 255, 255, 0.8);
}
.nuclide-dash-result-context-row-line-number {
  margin-right: 10px;
  min-width: 40px;
  text-align: right;
}
